<!DOCTYPE html>
<html>
<head>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        body {
            background-color: #333;
            margin: 0;
            padding: 0;
            text-align: center;
            height: 100%;
            background-repeat: no-repeat;
            background-image: url("assets/background.jpg");
            background-size: cover;
            background-position: center;
        }

        #game {
            margin: 0px auto;
            display: inline-block;
            position: absolute;
            top: 30%;
            left: 20%;
            right: 20%;
            color: #cccccc;
        }

        #game a {
            color: #333333;
            background-color: #cccccc;
            margin: 20px;
            padding:20px;
            border-radius: 5px;
        }
        #game a:hover {
            background-color: #ffccee;
            color: #554433;
        }

        #laptop {
            width: auto;
            height: 99vh;
            overflow: hidden;

        }

        #battery {
            background-repeat: no-repeat;
            background-size: contain;
            position: absolute;

        }

        .battery0 {
            background-image: url("assets/battery0.png");
        }

        .battery1 {
            background-image: url("assets/battery1.png");
        }

        .battery2 {
            background-image: url("assets/battery2.png");
        }

        .battery3 {
            background-image: url("assets/battery3.png");
        }

        .battery4 {
            background-image: url("assets/battery4.png");
        }

        @keyframes blink-red {
            0% {
                fill: #cccccc;
            }
            50% {
                fill: red;
            }
            100% {
                fill: #cccccc;
            }
        }

        @keyframes act-green {
            0% {
                fill: #cccccc;
            }
            10% {
                fill: lime;
            }
            15% {
                fill: #cccccc;
            }
            20% {
                fill: lime;
            }
            30% {
                fill: #cccccc;
            }
            40% {
                fill: lime;
            }
            44% {
                fill: #cccccc;
            }
            70% {
                fill: lime;
            }
            77% {
                fill: #cccccc;
            }
            80% {
                fill: lime;
            }
            84% {
                fill: #cccccc;
            }
            100% {
                fill: lime;
            }
        }

        @keyframes act-yellow {
            0% {
                fill: #cccccc;
            }
            5% {
                fill: yellow;
            }
            8% {
                fill: #cccccc;
            }
            14% {
                fill: yellow;
            }
            70% {
                fill: #cccccc;
            }
            80% {
                fill: yellow;
            }
            84% {
                fill: #cccccc;
            }
            90% {
                fill: yellow;
            }
            98% {
                fill: #cccccc;
            }
            100% {
                fill: yellow;
            }
        }

        #led1 {
            fill: #cccccc;
        }

        #led2 {
            fill: #cccccc;
            animation-name: blink-red;
            animation-duration: 0s;
            animation-iteration-count: infinite;
            animation-timing-function: steps(1);
        }

        #led3 {
            fill: #cccccc;
            animation-name: act-green;
            animation-duration: 0s;
            animation-iteration-count: infinite;
            animation-direction: alternate;
        }

        #led4 {
            fill: #cccccc;
            animation-name: act-yellow;
            animation-duration: 0s;
            animation-iteration-count: infinite;
            animation-direction: alternate;
            animation-timing-function: steps(1);

        }
    </style>
</head>
